import React from "react";
import { Navbar } from "../../shared/components/navbar/Navbar";
import { FormsPersons } from "./forms/FormsPerson";
import { IndexComponents } from "./index.components";
import { ListPerson } from "./list/listPerson";
import "./styles.css";
export const IndexPerson = () => {
  const { products, selectionchange, selectedProducts2 } = IndexComponents();
  return (
    <React.Fragment>
      <Navbar />
      <div className="container-fluid">
        <ListPerson products={products} selectionchange={selectionchange} />
        <FormsPersons data={selectedProducts2} />
      </div>
    </React.Fragment>
  );
};
